  const [queryWord, setQueryWord] = useState("");

  const storeYoutubeLink = (link) => {
    setYoutubeLink(link);
  };

  const storeQueryWord = (word) => {
    setQueryWord(word);
    console.log(queryWord);
  };

  return (
    <>
      <HomeHeader />
      <YoutubeForm storeLink={storeYoutubeLink} storeWord={storeQueryWord} />
    </>
  );
};

export default YoutubeHome;
